import React, { useState } from 'react';
import { Grid, Paper, Typography, List, ListItem, ListItemText, } from '@material-ui/core';


const styles = {
    paper: {

        padding : "15px",
        margin : "5px",
        marginBottom : "10px",
        height : "500px",
        overflow : "auto"

    }
}

export default ({ exercises, selectedSubCategory }) => {
    return (
        <div>
        <Grid container>
            <Grid item xs>
                <Paper style = {{...styles.paper, textTransform : "capitalize"}}>
                    {exercises.length !== 2 ? exercises.map(([group, items]) => {
                        return (
                    <div>
                    <Typography variant="subtitle1">{group}</Typography>
                    <List component="nav" aria-label="secondary mailbox folders">

                            {items.map(x => {
                                return (
                                    <ListItem button>
                                <ListItemText primary={x.title} onClick = {() => console.log("Yes")} />
                                </ListItem>
                                )
                            })}

                    </List>
                    </div>
                    )

                    })
                    : <div>
                    <Typography variant="subtitle1">{exercises[0]}</Typography>
                    <List component="nav" aria-label="secondary mailbox folders">

                            {exercises[1].map(x => {
                                return (
                                    <ListItem button>
                                <ListItemText primary={x.title} onClick = {() => console.log(x)} />
                                </ListItem>
                                )
                            })}

                    </List>
                    </div>


                    }
                </Paper>
        </Grid>
        <Grid item xs>
                <Paper style = {styles.paper}>
                    <Typography 
                    variant = "h4"  style = {{marginBottom : "10px"}} >{selectedSubCategory[0]}

                    </Typography>
                    <Typography 
                    variant = "h6"  style = {{marginBottom : "10px"}} >{selectedSubCategory[1][0].title}

                    </Typography>
                    <Typography variant = "body1" >{selectedSubCategory[1][0].description}
                    </Typography>
                </Paper>
        </Grid>

        </Grid>
        </div>
    )
}
